import React from "react";
import { TextField, withStyles, useStyles } from "@material-ui/core";
import { placeholder } from "@babel/types";
const styles = {
  input: {
    color: "#fff"
  },
  placeholder: {
    border: "1px solid red"
  }
};

const NavBarSearch = () => {
  return (
    <>
      <form style={styles.input} color="red" noValidate autoComplete="off">
        <TextField
          style={styles.placeholder}
          id="standard-basic"
          label="Search"
        />
      </form>
    </>
  );
};

export default NavBarSearch;
